import "./App.css";

import Card from "./Components/Card";
import data from "./Components/data";


const Propagonist = "Krishna";

const ch = () => {
  if (Propagonist === "Arjun") {
    return (
      <Card
        title={data[0].title}
        imglink={data[0].imglink}
        info={data[0].info}
      />
    );
  } else if (Propagonist === "Krishna") {
    return (
      <Card
        title={data[1].title}
        imglink={data[1].imglink}
        info={data[1].info}
      />
    );
  }
};



function App() {

  return (
    <div className="App">
      <div className="cardblock">

        {ch()}
      </div>
    </div>
  );
}

export default App;
